import{_ as p}from"./plugin-vue_export-helper-c27b6911.js";import{o as _,c as e,e as t}from"./app-60a1dd49.js";const o={},c=t("<p>《三命通会》卷 八·六丙日戊戌时断</p><p>六丙日生时戊戌，火局之中遇食神；月气火通为福寿，不通逢吉亦常人。</p><p>丙日戊戌时，寿永，名利不失。</p><p>寅亥卯未印及申酉戌已年月生，贵。</p><p>丙寅日戊戌时，庙堂食神，丙以戊为食神寿星，戌上丙火入库，戊土专位，若通火气月及东南运，福厚有寿；不通，平常。</p><p>丙子日戊戌时，寿永，名利不失。</p><p>家亥卯未印及申酉戌已年胜，贵。</p><p>丙子日戊戌时，夏月，福寿双全。</p><p>春，木克土，食神被枭。</p><p>寅月，丙戊俱长生，最吉。</p><p>有申庚制甲，大贵。</p><p>秋冬火衰贫下。</p><p>巳申亥年月，风宪极品。</p><p>丙辰日戊戌时，午月，丙火有气，土厚地方，五六品贵。</p><p>亥月，金火运，风宪。</p><p>丙午日戊戌时，羊刃食神健旺，名利骤发，亥未辰戌年月，西方运，风宪。</p><p>丙申日戊戌时，亥月，东方运，贵。</p><p>寅午身旺，干透财，吉。</p><p>丑辰刑冲戌库，发于晚年。</p><p>丙戌日戊戌时贫，若通寅巳午戌火局，福寿双全，大贵。</p><p>见财亦吉。</p><p>时上食神局，楼台店舍中；茶房饼酒肆，几度立家风。</p><p>丙日戌时财库开，少年未遇且沈埋；运通早晚通官爵，设若无官也发财。</p><p>丙日时逢戊戌，就中仓库兼全。</p><p>重重福禄自天然，富贵妻贤子羡。</p><p>君子文章早立，常人财物绵延。</p><p>天孤父母早淹连，辰戌钥匙开显。</p>",27),r=[c];function s(n,a){return _(),e("div",null,r)}const f=p(o,[["render",s],["__file","202卷 八·六丙日戊戌时断.html.vue"]]);export{f as default};
